webpackJsonp([0x6d2303377df5],{443:function(e,a){e.exports={data:{markdownRemark:{html:'<p>ReactiveSearch Native is built on the same philosophy as <a href="https://opensource.appbase.io/reactive-manual/">ReactiveSearch for web</a>. It shares the same advanced concepts. A list of guides are mentioned below which are common for both the web and native version.</p>\n<h3 id="custom-queries"><a href="#custom-queries" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Custom Queries</h3>\n<p>ReactiveSearch components come with default Elasticsearch queries. In case you wish to use your own custom queries, the filter components provide a <code>customQuery</code> prop. Check the detailed guide <a href="https://opensource.appbase.io/reactive-manual/advanced/customquery.html">here</a>.</p>\n<h3 id="react-prop"><a href="#react-prop" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>React prop</h3>\n<p>One of the key ideas behind ReactiveSearch is the reactive design pattern, which allows defining how a component reacts to changes in the states of other components. This is acheived by the <code>react</code> prop supported by ReactiveSearch components. Check the detailed guide <a href="https://opensource.appbase.io/reactive-manual/advanced/react.html">here</a>.</p>\n<h3 id="writing-and-editing-data"><a href="#writing-and-editing-data" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Writing and Editing Data</h3>\n<p>ReactiveSearch components are great for reading data, but at times you might want to create, update or delete your data. <a href="https://opensource.appbase.io/reactive-manual/advanced/writingdata.html">Here</a> is a detailed guide on performing write operations.</p>\n<h3 id="comparison-with-other-projects"><a href="#comparison-with-other-projects" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Comparison with Other Projects</h3>\n<p>Weâ€™ve a detailed comparison of ReactiveSearch with other projects with similar aims <a href="https://opensource.appbase.io/reactive-manual/advanced/comparison.html">here</a>. Contributions are welcome!</p>',frontmatter:{title:"Advanced Guides",next:null,prev:"advanced/build.html",nextTitle:null,prevTitle:"Building with Native Code"},fields:{path:"docs/advanced/Guides.md",slug:"advanced/guides.html"}}},pathContext:{slug:"advanced/guides.html"}}}});
